    public List<Integer> mySolution_1(String s, String[] words) {
        if (s == null || s.length() == 0 || words == null || words.length == 0) {
            return new ArrayList<>();
        }
        boolean[] visits = new boolean[words.length];
        int length = 0;
        for (int i = 0; i < words.length; i++) {
            length = length + words[i].length();
        }
        Set<Integer> set = new HashSet<>();
        recursive_1(0, 0, length, s, words, visits, set);
        return new ArrayList<>(set);
    }

    // 超时，栈溢出
    public boolean recursive_1(int start, int visitCount, int length, String s, String[] words, boolean[] visits, Set<Integer> set) {
        if (visitCount == visits.length) {
            set.add(start - length);
            return true;
        }
        for (int i = 0; i < words.length; i++) {
            if (visits[i]) {
                continue;
            }
            int index = start;
            boolean find = false;
            while ((index = s.indexOf(words[i], index)) != -1) {
                if (start != 0 && index != start) {
                    break;
                }
                if (start == 0 && set.contains(index)) {
                    index++;
                    continue;
                }
                visits[i] = true;
                visitCount++;
                find = recursive_1(index + words[i].length(), visitCount, length, s, words, visits, set);
                visits[i] = false;
                visitCount--;
                if (find && start != 0) {
                    return true;
                }
                index++;
            }
        }
        return false;
    }

    public List<Integer> mySolution_2(String s, String[] words) {
        Map<Integer, Set<String>> map = new HashMap<>();
        Map<String, Integer> temp = new HashMap<>();
        List<Integer> res = new ArrayList<>();
        for (int i = 0; i < words.length; i++) {
            int index = s.indexOf(words[i]);
            if (index == -1) {
                return res;
            }
            while (index != -1) {
                map.put(index, map.getOrDefault(index, new HashSet<String>()));
                map.get(index).add(words[i]);
                index = s.indexOf(words[i], index + 1);
            }
            temp.put(words[i], temp.getOrDefault(words[i], 0) + 1);
        }
        for (Map.Entry<Integer, Set<String>> entry : map.entrySet()) {
            if (recursive_2(entry.getKey(), map, temp)) {
                res.add(entry.getKey());
            }
        }
        return res;
    }

    // 超时，栈溢出
    public boolean recursive_2(int start, Map<Integer, Set<String>> map, Map<String, Integer> temp) {
        if (temp.isEmpty()) {
            return true;
        }
        Set<String> set = map.get(start);
        if (set != null) {
            for (String s : set) {
                if (temp.containsKey(s)) {
                    int count = temp.get(s);
                    count--;
                    if (count == 0) {
                        temp.remove(s);
                    } else {
                        temp.put(s, count);
                    }
                    boolean find = recursive_2(start + s.length(), map, temp);
                    count++;
                    temp.put(s, count);
                    if (find) {
                        return true;
                    }
                }
            }
        }
        return false;
    }

    // 滑动窗口
    public List<Integer> mySolution_3(String s, String[] words) {
        List<Integer> res = new ArrayList<>();
        if (s == null || s.length() == 0 || words == null || words.length == 0) {
            return res;
        }
        HashMap<String, Integer> map = new HashMap<>();
        int oneWord = words[0].length();
        int wordNum = words.length;
        int allLen = oneWord * wordNum;
        for (String word : words) {
            map.put(word, map.getOrDefault(word, 0) + 1);
        }
        for (int i = 0; i < s.length() - allLen + 1; i++) {
            int right = i, count = 0;
            HashMap<String, Integer> tmpMap = new HashMap<>();
            while (right + oneWord <= s.length()) {
                String w = s.substring(right, right + oneWord);
                right = right + oneWord;
                if (!map.containsKey(w)) {
                    break;
                } else {
                    tmpMap.put(w, tmpMap.getOrDefault(w, 0) + 1);
                    if (tmpMap.get(w) > map.get(w)) {
                        break;
                    }
                    count++;
                    if (count == wordNum) {
                        res.add(i);
                        break;
                    }
                }
            }
        }
        return res;
    }
